import { Fragment, useState } from 'react'
import logo from '../assets/images/logo.png'
import { Link, useNavigate } from 'react-router-dom'
import loginLogo from '../assets/images/main_login_pic.png'
import googleLogo from '../assets/images/google_icon.png'
import Footer from '../general/Footer'
import HomePage from '../home_page/HomePage'
import fontawesome from '../assets/font/fontawesome-free-6.2.0-web/css/all.min.css'
export default function Login(props) {
    const userApi = 'https://jsonplaceholder.typicode.com/users'
    const navigate = useNavigate()
    // const loginBtn = document.querySelector('.header__auth')

    function hideAuthButton() {
        // loginBtn.classList.add('disable');
    }

    function login() {
        getUser(handleLogin);
    }
    login();
    function getUser(callback) {
        fetch(userApi)
            .then(function (response) {
                return response.json();
            })
            .then(callback);
    }


    function handleLogin(datas) {
        var btnLogin = document.getElementById('js-login-btn');
        btnLogin.onclick = function () {
            var username = document.querySelector('input[name="username"]').value;
            var password = document.querySelector('input[name="password"]').value;
            if (username == '' || password == '') {
                console.log('Please enter your username and password');
            }
            var flat = false;
            datas.forEach(data => {
                if (data.username === username && data.name === password) {
                    flat = true;
                }
            });
            if (flat) {
                console.log('success')
                navigate('/', { replace: true })
                hideAuthButton()
            }
            else {
                console.log('error')
            }
        }
    }
    return (
        <Fragment>
            <header className="header">
                <div className="grid wide header__control">
                    <ul className="header__1">
                        <li className="list__logo">
                            <a className="header__logo-link" href="/#">
                                <img className="header__img" src={logo} alt="Logo" />
                            </a>
                        </li>
                        <li className="list__login">
                            <div className="header__text">SIGN IN</div>
                        </li>
                    </ul>
                    <div className="header__help">
                        <a className="help__text" href="/#">Need help?</a>
                    </div>
                </div>
            </header>
            <div className="container">
                <div className="grid wide">
                    <div className="row">
                        <div className="l-6 img__control">
                            <img className="img__login" src={loginLogo} alt="" />
                        </div>
                        <div className="l-6 form__control">
                            {/* <div className="auth-form"> */}
                            <form action="" method="POST" class="auth-form" id="form-1">
                                <h4 className="auth-form__title">FLOWER CORNER</h4>
                                <p className="auth-form__des">Login to your account</p>

                                <div class="auth-form__group">
                                    <label for="fullname" class="form-label">Full Name</label>
                                    <input id="fullname" name="fullname" type="text" placeholder="VD: Nguyễn An" class="auth-form__input" />
                                    <span class="form-message"></span>
                                </div>

                                <div class="auth-form__group">
                                    <label for="email" class="form-label">Email</label>
                                    <input id="email" name="email" type="text" placeholder="VD: email@domain.com" class="auth-form__input" />
                                    <span class="form-message"></span>
                                </div>

                                <div class="auth-form__group">
                                    <label for="password" class="form-label">Password</label>
                                    <input id="password" name="password" type="password" placeholder="Nhập mật khẩu" class="auth-form__input" />
                                    <span class="form-message"></span>
                                </div>

                                <button class="btn btn__auth">Đăng ký</button>
                            </form>
                            {/* </div> */}
                        </div>
                    </div>
                </div>
            </div>
            <Footer />
        </Fragment>
    )
}
